# === Logging + Error-Handling ===
function Log {
    param(
        [string]$Message,
        [string]$Level = "INFO"
    )
    $timestamp = Get-Date -Format 'yyyy-MM-dd HH:mm:ss'
    $prefix = switch ($Level) {
        "INFO"     { "ℹ️" }
        "SUCCESS"  { "✅" }
        "ERROR"    { "❌" }
        "DEBUG"    { "🐛" }
        default    { "🔹" }
    }

    # === Kopfzeile nur einmal schreiben, wenn Logfile neu ist ===
    if (-not (Test-Path $LogFile)) {
        $osInfo = Get-CimInstance Win32_OperatingSystem
        $deviceName = $env:COMPUTERNAME
        $localIPs = (Get-NetIPAddress -AddressFamily IPv4 |
                      Where-Object { $_.IPAddress -notlike '169.*' } |
                      Select-Object -ExpandProperty IPAddress) -join ", "
        try {
            $publicIP = (Invoke-RestMethod -Uri "https://api.ipify.org").Trim()
        } catch {
            $publicIP = "Abruf fehlgeschlagen"
        }
        $scriptPath = $MyInvocation.MyCommand.Path

        $header = @(
            "=== Logfile gestartet: $(Get-Date -Format 'yyyy-MM-dd HH:mm:ss') ==="
            "OS Version   : $($osInfo.Caption) $($osInfo.Version)"
            "Gerätename   : $deviceName"
            "Lokale IPs   : $localIPs"
            "Öffentliche IP: $publicIP"
            "Script-Pfad  : $scriptPath"
            "==============================================="
            ""
        )
        $header | Out-File -FilePath $LogFile -Encoding utf8 -Append
    }

    # === Log-Eintrag schreiben ===
    $logEntry = "$timestamp $prefix $Message"
    $logEntry | Out-File -FilePath $LogFile -Encoding utf8 -Append
    Write-Host $logEntry -Encoding utf8
}

function Handle-Error {
    param (
        [string]$Message,
        [object]$ErrorObject
    )

    $exceptionMessage = switch ($ErrorObject) {
        { $_ -is [System.Exception] } { $_.Message }
        { $_ -is [System.Management.Automation.ErrorRecord] } { $_.Exception.Message }
        default { "$ErrorObject" }
    }

    $fullMessage = "${Message}: $exceptionMessage"

    $timestamp = Get-Date -Format 'yyyy-MM-dd HH:mm:ss'
    $logEntry = "$timestamp ❌ $fullMessage"
    $logEntry | Out-File -FilePath $LogFile -Encoding utf8 -Append
    Write-Host $logEntry -ForegroundColor Red
}
# === Ende Logging + Error-Handling ===




