#region: Modulcheck & Auto-Install
function Test-Module {
    [CmdletBinding()]
    param([string]$ModuleName)
    if (-not (Get-Module -ListAvailable -Name $ModuleName)) {
        Write-Host "📦 Modul '$ModuleName' wird installiert..." -ForegroundColor Yellow
        if (-not (Get-PSRepository -Name PSGallery -ErrorAction SilentlyContinue)) {
            Register-PSRepository -Default
        }
        [Net.ServicePointManager]::SecurityProtocol = [Net.SecurityProtocolType]::Tls12
        Install-Module -Name $ModuleName -Scope CurrentUser -Force -AllowClobber
    }
}
Test-Module -ModuleName "ExchangeOnlineManagement"
Test-Module -ModuleName "ImportExcel"
Import-Module ExchangeOnlineManagement -Force
Import-Module ImportExcel -Force
#endregion

#region: Base64 Bereinigung
function Remove-Base64Prefix {
    [CmdletBinding()]
    param([string]$Base64)
    if ($Base64 -match '^data:image\/[a-z]+;base64,') {
        return $Base64 -replace '^data:image\/[a-z]+;base64,', ''
    }
    return $Base64
}
#endregion


function Create-ImageFromBase64 {
    param($Base64)
    try {
        $clean = $Base64 -replace '^data:image\/[a-z]+;base64,', ''
        $bytes = [Convert]::FromBase64String($clean)
        $ms = New-Object IO.MemoryStream (,[byte[]]$bytes)
        return [System.Drawing.Image]::FromStream($ms)
    } catch {
        Log "❌ Fehler beim Konvertieren von Base64-Logo: $_" "ERROR"
        return $null
    }
}

$CompanyLogo = $null
if ($CompanyLogoBase64 -and $CompanyLogoBase64.Length -gt 100) {
    $CompanyLogo = Create-ImageFromBase64 $CompanyLogoBase64
}
$ProductLogo = $null
if ($ProductLogoBase64 -and $ProductLogoBase64.Length -gt 100) {
    $ProductLogo = Create-ImageFromBase64 $ProductLogoBase64
}


#region: Logging-Funktion für GUI
function Write-GuiLog {
    param(
        [string]$Message,
        [string]$Type = "info" # "info", "ok", "warn", "error"
    )
    $logBox = $window.FindName("txtGuiLog")
    if ($logBox) {
        $stamp = (Get-Date -Format 'HH:mm:ss')
        $prefix = switch ($Type) {
            "error" { "❌" }
            "warn"  { "⚠️" }
            "ok"    { "✅" }
            default { "ℹ️" }
        }
        $msg = "$stamp  $prefix $Message`r`n"
        $logBox.AppendText($msg)
        $logBox.ScrollToEnd()
    }
    Write-Host "$Message"
}
#endregion


# === Druck per Company ================
# Aufruf: Export-CompanyReports -Labels $labels -OutputRoot "C:\Reports\Company-Reports"
# ===

function Export-CompanyReports {
    param(
        [Parameter(Mandatory)]
        [array]$Labels,
        [string]$OutputRoot = "C:\Temp\Company-Reports"
    )

    # Gruppierung der Labels nach 4-stelligem Buchungscode im DisplayName, sonst "0000"
    $groupedLabels = $Labels | Group-Object {
        if ($_.DisplayName -match '^(\d{4})') { $matches[1] }
        elseif ($_.DisplayName -match '(\d{4})$') { $matches[1] }
        else { "0000" }
    }

    foreach ($group in $groupedLabels) {
        $Buchungscode = $group.Name
        $LabelsBlock = $group.Group | Select-Object -First 9

        # Firmenname aus Tooltip (wenn vorhanden)
        $companyName = ($LabelsBlock | Where-Object { $_.Raw.Tooltip -match ' - (.+)$' } | Select-Object -First 1).Raw.Tooltip -replace '.* - ', ''
        if (-not $companyName) { $companyName = "UnbekannteFirma" }

        # Ordner anlegen
        $outputDir = Join-Path $OutputRoot $companyName
        if (-not (Test-Path $outputDir)) { New-Item -Path $outputDir -ItemType Directory -Force | Out-Null }

        $datum = Get-Date -Format 'yyyyMMdd_HHmmss'
        function Convert-CompanyNameToFileName {
            param([string]$Name)
            $Name = $Name -replace 'ä', 'ae'
            $Name = $Name -replace 'ö', 'oe'
            $Name = $Name -replace 'ü', 'ue'
            $Name = $Name -replace 'Ä', 'Ae'
            $Name = $Name -replace 'Ö', 'Oe'
            $Name = $Name -replace 'Ü', 'Ue'
            $Name = $Name -replace 'ß', 'ss'
            $Name = $Name -replace '[ &]', ''
            $Name = $Name -replace '[^a-zA-Z0-9_\-]', '_'
            return $Name
        }
        $companyNameFile = Convert-CompanyNameToFileName $companyName

        $WordPath = [System.IO.Path]::Combine($outputDir, "PurviewExport_${companyNameFile}-$Buchungscode-$datum.docx")
        $PdfPath  = [System.IO.Path]::Combine($outputDir, "PurviewExport_${companyNameFile}-$Buchungscode-$datum.pdf")

        # Word-Dokument erstellen
        $word = New-Object -ComObject Word.Application
        $word.Visible = $false
        $doc = $word.Documents.Add()
        $selection = $word.Selection

        # Kopf- und Fußzeile ab Seite 2 nach Vorgabe einrichten
        $section = $doc.Sections.Item(1)
        $section.PageSetup.DifferentFirstPageHeaderFooter = $true

        # --- Kopfzeile ---
        $header = $section.Headers([Microsoft.Office.Interop.Word.WdHeaderFooterIndex]::wdHeaderFooterPrimary)
        $header.Range.Text = ""
        $header.Range.ParagraphFormat.TabStops.ClearAll()
        # Tabstopp rechts auf 16cm (A4)
        $header.Range.ParagraphFormat.TabStops.Add(16 * 28.35) | Out-Null
        $headerText = "Compliance Labels - $companyName`t"
        $header.Range.Text = $headerText

        # --- Fußzeile ---
        $footer = $section.Footers([Microsoft.Office.Interop.Word.WdHeaderFooterIndex]::wdHeaderFooterPrimary)
        $footer.Range.Text = ""
        $footer.Range.ParagraphFormat.TabStops.ClearAll()
        $footer.Range.ParagraphFormat.TabStops.Add(16 * 28.35) | Out-Null

        # Linksbündig: Seite x von y
        $footer.Range.Text = "Seite "
        $footer.Range.Collapse([Microsoft.Office.Interop.Word.WdCollapseDirection]::wdCollapseEnd)
        $footer.Range.Fields.Add($footer.Range, [Microsoft.Office.Interop.Word.WdFieldType]::wdFieldPage)
        $footer.Range.InsertAfter(" von ")
        $footer.Range.Collapse([Microsoft.Office.Interop.Word.WdCollapseDirection]::wdCollapseEnd)
        $footer.Range.Fields.Add($footer.Range, [Microsoft.Office.Interop.Word.WdFieldType]::wdFieldNumPages)

        # Rechtsbündig: Erstellt am: Datum (ohne Uhrzeit)
        $footer.Range.InsertAfter("`t")
        $footer.Range.Collapse([Microsoft.Office.Interop.Word.WdCollapseDirection]::wdCollapseEnd)
        $exportDatum = Get-Date -Format 'dd.MM.yyyy'
        $footer.Range.InsertAfter("Erstellt am: $exportDatum")


##############################################################
        # === Deckblatt ===
#        $selection.Style = "Titel"
#        $selection.TypeText("Compliance Label Report – Export")
#        $selection.TypeParagraph()
#        $selection.TypeText("Company: $companyName")
#        $selection.TypeParagraph()
#        $selection.TypeText("Erstellt am: $(Get-Date -Format 'dd.MM.yyyy HH:mm:ss')")
#        $selection.TypeParagraph()
#        $selection.InsertNewPage()

##############################################################


    # === Deckblatt: Abschnitt 1 - Company Logo (oben zentriert) ===
    if ($CompanyLogoPath -and (Test-Path $CompanyLogoPath)) {
        $selection.ParagraphFormat.Alignment = 1
        $selection.InlineShapes.AddPicture($CompanyLogoPath, $false, $true)
        $selection.TypeParagraph()
        $selection.TypeParagraph()
    }
    elseif ($CompanyLogoBase64 -and $CompanyLogoBase64.Length -gt 100) {
        $bytes = [Convert]::FromBase64String(($CompanyLogoBase64 -replace '^data:image\/[a-z]+;base64,', ''))
        $LogoFile = [System.IO.Path]::Combine($LogFolder, "CompanyLogo_$DatumJetzt.png")
        [IO.File]::WriteAllBytes($LogoFile, $bytes)
        $selection.ParagraphFormat.Alignment = 1
        $selection.InlineShapes.AddPicture($LogoFile, $false, $true)
        $selection.TypeParagraph()
        $selection.TypeParagraph()
    }

    # === Abschnitt 2 - Titel und Metadaten ===
        $selection.Style = "Titel"
        $selection.TypeText("M365 Purview Sensitivity Labels – $Tenantdomain")
        # $selection.TypeText("Erste Zeile")
        $selection.TypeText([char]11)
        # $selection.TypeText("Zweite Zeile (gleicher Absatz, neue Zeile)")
        # $selection.TypeText("$Tenantdomain")
        $selection.TypeText("Tenantdomain: $Tenantdomain")
        # $selection.TypeParagraph()
        $selection.TypeParagraph()
        $selection.TypeParagraph()
        $selection.TypeText("Company: $companyName")
        $selection.TypeParagraph()
        $selection.TypeText("Erstellt am: $DatumAnzeige")
        $selection.TypeParagraph()
        $selection.TypeText("Autor: Microsoft Purview Automation")
        $selection.TypeParagraph()
        $selection.TypeParagraph()
    
    # === Abschnitt 3 - Produktlogo (unten zentriert) ===
    if ($LogoUrl -and $LogoUrl.Trim() -ne "") {
        $LogoFile = [System.IO.Path]::Combine($LogFolder, "ProductLogo_$DatumJetzt.png")
        $wc = New-Object Net.WebClient
        $wc.DownloadFile($LogoUrl, $LogoFile)
        $selection.ParagraphFormat.Alignment = 1
        $shape = $selection.InlineShapes.AddPicture($LogoFile, $false, $true)
        $shape.Width  = $shape.Width * 0.5
        $shape.Height = $shape.Height * 0.5
    }
    elseif ($ProductLogoBase64 -and $ProductLogoBase64.Length -gt 100) {
        $bytes = [Convert]::FromBase64String(($ProductLogoBase64 -replace '^data:image\/[a-z]+;base64,', ''))
        $LogoFile = [System.IO.Path]::Combine($LogFolder, "ProductLogo_$DatumJetzt.png")
        [IO.File]::WriteAllBytes($LogoFile, $bytes)
        $selection.ParagraphFormat.Alignment = 1
        $shape = $selection.InlineShapes.AddPicture($LogoFile, $false, $true)
        $shape.Width  = $shape.Width * 0.5
        $shape.Height = $shape.Height * 0.5
    }



        # Inhaltsverzeichnis
        $tocRange = $selection.Range
        $missing = [System.Type]::Missing
        $doc.TablesOfContents.Add(
            $tocRange,
            $true, 1, 3, $true, "", $true, $true, $missing, $true, $false
        )
        $selection.InsertNewPage()

        # === Labels einfügen ===
        foreach ($labelObj in $LabelsBlock | Sort-Object Priority) {
            # $labelObj: enthält Selected, Priority, Name, DisplayName, Raw
            $label = $labelObj.Raw

            $selection.Style = "Überschrift 1"
            $selection.TypeText($label.DisplayName)
            $selection.TypeParagraph()
            $selection.Style = "Standard"
            $selection.TypeText("Name: $($label.Name)")
            $selection.TypeParagraph()
            $selection.TypeText("Priority: $($label.Priority)")
            $selection.TypeParagraph()
            if ($label.Name)                { $selection.TypeText("Name: $($label.Name)"); $selection.TypeParagraph() }
            if ($label.DisplayName)         { $selection.TypeText("DisplayName: $($label.DisplayName)"); $selection.TypeParagraph() }
            if ($label.Priority)            { $selection.TypeText("Priority: $($label.Priority)"); $selection.TypeParagraph() }
            if ($label.Tooltip)             { $selection.TypeText("Tooltip: $($label.Tooltip)"); $selection.TypeParagraph() }
            if ($label.Description)         { $selection.TypeText("Description: $($label.Description)"); $selection.TypeParagraph() }
            if ($label.ContentType)         { $selection.TypeText("ContentType: $($label.ContentType)"); $selection.TypeParagraph() }
            if ($label.Enabled -ne $null)   { $selection.TypeText("Enabled: $($label.Enabled)"); $selection.TypeParagraph() }
            if ($label.ImmutableId)         { $selection.TypeText("ImmutableId: $($label.ImmutableId)"); $selection.TypeParagraph() }
            if ($label.PublisherName)       { $selection.TypeText("PublisherName: $($label.PublisherName)"); $selection.TypeParagraph() }
            if ($label.CreatedBy)           { $selection.TypeText("Ersteller: $($label.CreatedBy)"); $selection.TypeParagraph() }
            if ($label.WhenCreated) {
                $selection.TypeText("Erstellt am: $(([datetime]$label.WhenCreated).ToString('dd.MM.yyyy HH:mm:ss'))")
                $selection.TypeParagraph()
            }
            if ($label.WhenChanged) {
                $selection.TypeText("Geändert am: $(([datetime]$label.WhenChanged).ToString('dd.MM.yyyy HH:mm:ss'))")
                $selection.TypeParagraph()
            }
            if ($label.LastModifiedBy)           { $selection.TypeText("Geändert von: $($label.LastModifiedBy)"); $selection.TypeParagraph() }

            # Parentlabel-Logik
            if ($label.IsParent -eq $true) {
                $selection.TypeText("Parentlabel")
                $selection.TypeParagraph()

                # Childlabels suchen
                $childLabels = $labels | Where-Object { $_.ParentLabelDisplayName -eq $label.DisplayName }
                if ($childLabels) {
                    $selection.TypeText("Childlabels:")
                    $selection.TypeParagraph()
                    foreach ($child in $childLabels) {
                        $selection.TypeText(" - $($child.DisplayName)")
                        $selection.TypeParagraph()
                    }
                } else {
                    $selection.TypeText("(Keine Childlabels gefunden)")
                    $selection.TypeParagraph()
                }
            }
            elseif ($label.IsParent -eq $false -and $label.ParentLabelDisplayName) {
                $selection.TypeText("Parentlabel = $($label.ParentLabelDisplayName)")
                $selection.TypeParagraph()
            }

            # Arrays oder komplexe Properties:
            # LocaleSettings
            if ($label.PSObject.Properties["LocaleSettings"] -and $label.LocaleSettings) {
                $selection.InsertBreak([Microsoft.Office.Interop.Word.WdBreakType]::wdPageBreak)
                $selection.Style = "Überschrift 2"
                $selection.TypeText("Locale Settings")
                $selection.TypeParagraph()
                $raw = $label.LocaleSettings -replace '}\s*{','}|SPLIT|{'
                $jsonParts = $raw -split '\|SPLIT\|'
                $locales = @{}
                foreach ($part in $jsonParts) {
                    try {
                        $obj = $part | ConvertFrom-Json -ErrorAction Stop
                        $localeKey = $obj.LocaleKey
                        foreach ($entry in $obj.Settings) {
                            $lang = $entry.Key
                            $value = $entry.Value
                            if (-not $locales.ContainsKey($lang)) { $locales[$lang] = @{} }
                            $locales[$lang][$localeKey] = $value
                        }
                    } catch {}
                }
                foreach ($lang in ($locales.Keys | Sort-Object)) {
                    $selection.Style = "Überschrift 3"
                    $selection.TypeText("Sprache: $lang")
                    $selection.TypeParagraph()
                    $selection.Style = "Standard"
                    $entry = $locales[$lang]
                    if ($entry.displayName) { $selection.TypeText("   • Name: $($entry.displayName)"); $selection.TypeParagraph() }
                    if ($entry.tooltip)    { $selection.TypeText("   • Tooltip: $($entry.tooltip)"); $selection.TypeParagraph() }
                    if ($entry.description){ $selection.TypeText("   • Description: $($entry.description)"); $selection.TypeParagraph() }
                }
            }
            # LabelActions
            if ($label.PSObject.Properties["LabelActions"] -and $label.LabelActions) {
                # Seitenumbruch einfügen, damit "Label Actions" immer auf einer neuen Seite startet
                $selection.InsertBreak([Microsoft.Office.Interop.Word.WdBreakType]::wdPageBreak)
                $selection.Style = "Überschrift 2"
                $selection.TypeText("Label Actions")
                $selection.TypeParagraph()
                $raw = $label.LabelActions -replace '}\s*{','}|SPLIT|{'
                $jsonParts = $raw -split '\|SPLIT\|'
                foreach ($part in $jsonParts) {
                    try {
                        $action = $part | ConvertFrom-Json -ErrorAction Stop
                        $type = $action.Type
                        $subtype = if ($action.SubType) { $action.SubType } else { "-" }
                        $selection.Style = "Überschrift 3"
                        $selection.TypeText("Aktion: $type")
                        $selection.TypeParagraph()
                        $selection.Style = "Standard"
                        $selection.TypeText("Untertyp: $subtype")
                        $selection.TypeParagraph()
                        foreach ($setting in $action.Settings) {
                            $key = $setting.Key
                            $value = $setting.Value
                            if ($key -eq "rightsdefinitions" -and $value -match '^\s*\[') {
                                $selection.TypeText(" - ${key}:")
                                $selection.TypeParagraph()
                                try {
                                    $rights = $value | ConvertFrom-Json -ErrorAction Stop
                                    foreach ($entry in $rights) {
                                        $selection.TypeText("     • Identity: $($entry.Identity)")
                                        $selection.TypeParagraph()
                                        $selection.TypeText("       Rights: $($entry.Rights)")
                                        $selection.TypeParagraph()
                                    }
                                } catch {
                                    $selection.TypeText("     ⚠️ Fehler beim Parsen von rightsdefinitions")
                                    $selection.TypeParagraph()
                                }
                            } else {
                                $selection.TypeText(" - ${key}: $value")
                                $selection.TypeParagraph()
                            }
                        }
                    } catch {
                        $selection.TypeText("⚠️ Fehler beim Verarbeiten von LabelActions")
                        $selection.TypeParagraph()
                    }
                }
            }

            # Arrays wie $label.Sublabels, $label.Children, etc.
            foreach ($propName in @('Sublabels','Children','InformationTypes','LabelSettings')) {
                if ($label.PSObject.Properties[$propName] -and $label.$propName) {
                    $selection.Style = "Überschrift 2"
                    $selection.TypeText("$propName")
                    $selection.TypeParagraph()
                    foreach ($item in $label.$propName) {
                        $selection.Style = "Standard"
                        $selection.TypeText(" - $item")
                        $selection.TypeParagraph()
                    }
                }
            }
            $selection.InsertNewPage()
        }

        # Inhaltsverzeichnis updaten
        $doc.TablesOfContents.Item(1).Update()

        # Speichern
        $doc.SaveAs($WordPath, 16)
        $doc.SaveAs($PdfPath, 17)
        $doc.Close()
        $word.Quit()

        # COM cleanup
        [System.Runtime.InteropServices.Marshal]::ReleaseComObject($selection) | Out-Null
        [System.Runtime.InteropServices.Marshal]::ReleaseComObject($doc) | Out-Null
        [System.Runtime.InteropServices.Marshal]::ReleaseComObject($word) | Out-Null
        [System.GC]::Collect()
        [System.GC]::WaitForPendingFinalizers()

        Write-Host "✅ Bericht für $companyName ($Buchungscode) erstellt: $WordPath"
        Write-Host "✅ Bericht für $companyName ($Buchungscode) erstellt: $PdfPath"
    }
}

if ($ExportWordC) {

Export-CompanyReports -Labels $labels

