#region: Helper zum Setzen der Logos
function Set-Base64Image {
    [CmdletBinding()]
    param($ctrl, $Base64)
    $Base64 = Remove-Base64Prefix $Base64
    if ([string]::IsNullOrWhiteSpace($Base64)) { return }
    try {
        $bytes = [Convert]::FromBase64String($Base64)
        $ms = New-Object IO.MemoryStream (,[byte[]]$bytes)
        $img = [System.Windows.Media.Imaging.BitmapImage]::new()
        $img.BeginInit()
        $img.StreamSource = $ms
        $img.CacheOption = [System.Windows.Media.Imaging.BitmapCacheOption]::OnLoad
        $img.EndInit()
        $ctrl.Source = $img
    } catch {}
}
#endregion

#region: Spinner-Animation (Drehen der Ellipse)
function Start-Spinner {
    param($window)
    if ($global:UseGifSpinner) {
        $gifSpinner = $window.FindName("gifSpinner")
        if ($gifSpinner) {
            $gifSpinner.Visibility = "Visible"
            $gifSpinner.Source = [Uri]::new($GifPath)
            $gifSpinner.Position = [TimeSpan]::Zero
            $gifSpinner.Play()
        }
        $cnvSpinner = $window.FindName("cnvSpinner")
        if ($cnvSpinner) { $cnvSpinner.Visibility = "Collapsed" }
    } else {
        $gifSpinner = $window.FindName("gifSpinner")
        if ($gifSpinner) { $gifSpinner.Visibility = "Collapsed" }
        $cnvSpinner = $window.FindName("cnvSpinner")
        if ($cnvSpinner) { $cnvSpinner.Visibility = "Visible" }
        $spinner = $window.FindName("elSpinner")
        if ($spinner) {
            $script:_rt = New-Object Windows.Media.RotateTransform
            $spinner.RenderTransform = $script:_rt
            $spinner.RenderTransformOrigin = "0.5,0.5"
            $script:_spinAngle = 0
            if (-not $script:_spinTimer) {
                Add-Type -AssemblyName WindowsBase
                $script:_spinTimer = New-Object Windows.Threading.DispatcherTimer
                $script:_spinTimer.Interval = [TimeSpan]::FromMilliseconds(30)
                $script:_spinTimer.Add_Tick({
                    if ($script:_rt -and $script:_rt.PSObject.Properties.Match("Angle")) {
                        $script:_spinAngle = ($script:_spinAngle + 14) % 360
                        $script:_rt.Angle = $script:_spinAngle
                    }
                })
            }
            $script:_spinTimer.Start()
        }
    }
    $spWait = $window.FindName("spWait")
    if ($spWait) { $spWait.Visibility = "Visible" }
}
function Stop-Spinner {
    param($window)
    $spWait = $window.FindName("spWait")
    if ($spWait) { $spWait.Visibility = "Collapsed" }
    if ($global:UseGifSpinner) {
        $gifSpinner = $window.FindName("gifSpinner")
        if ($gifSpinner) {
            $gifSpinner.Stop()
            $gifSpinner.Visibility = "Collapsed"
        }
    } else {
        if ($script:_spinTimer) { $script:_spinTimer.Stop() }
        $cnvSpinner = $window.FindName("cnvSpinner")
        if ($cnvSpinner) { $cnvSpinner.Visibility = "Collapsed" }
    }
}

