#region: Filterfunktion für Buchungscode (4 Ziffern am Anfang/Ende)
function Find-LabelsByBookingCode {
    [CmdletBinding()]
    param($Labels, [string]$Code)
    if (-not $Code -or $Code -notmatch '^\d{4}$') { return $Labels }
    return $Labels | Where-Object {
        ($_.DisplayName -match "^$Code") -or ($_.DisplayName -match "$Code$")
    }
}
#endregion

#region: Sortiere Labels nach Prio
function Sort-LabelByPriority {
    [CmdletBinding()]
    param($Labels, [bool]$Asc)
    if ($Asc) { return $Labels | Sort-Object Priority,DisplayName }
    else      { return $Labels | Sort-Object Priority,DisplayName -Descending }
}
