# --- Neu laden (holt alle Labels erneut) ---
function Get-ComplianceLabel {
    [CmdletBinding()]
    param([string]$UPN)
    try {
#        Import-Module ExchangeOnlineManagement -Force
#        Connect-IPPSSession -UserPrincipalName $UPN -ErrorAction Stop
        $labels = Get-Label
        return $labels | ForEach-Object {
            [PSCustomObject]@{
                Selected    = $false
                Priority    = $_.Priority
                Name        = $_.Name
                DisplayName = $_.DisplayName
                CreatedBy   = $_.CreatedBy
                LastModifiedBy   = $_.LastModifiedBy
                WhenCreated   = $_.WhenCreated
                WhenChanged   = $_.WhenChanged
                IsParent      = $_.IsParent
                ParentLabelDisplayName = $_.ParentLabelDisplayName
                Raw         = $_
            }
        }
    } catch {
        [System.Windows.MessageBox]::Show("Verbindung oder Label-Abruf fehlgeschlagen: $_")
        return @()
    }
}
$window.FindName("btnRefresh").Add_Click({
    if (-not $script:UPN) { [System.Windows.MessageBox]::Show("Bitte UPN eingeben!"); return }
    # Spinrad anzeigen
    Start-Spinner $window
    $window.FindName("lblStatus").Content = "Labels werden geladen, bitte warten..."
    $window.FindName("lblStatus").Foreground = "DarkOrange"
    $window.FindName("dgLabels").ItemsSource = $null
    $window.FindName("dgLabels").IsEnabled = $false
    $window.Dispatcher.Invoke([action]{}, "Background") # GUI updaten

    Write-GuiLog "Lese Online Labels erneut ein, bitte warten..." "info"
    $labels = Get-ComplianceLabel -UPN $script:UPN
    $script:LabelTable = $labels
    $window.FindName("dgLabels").ItemsSource = $labels
    $window.FindName("dgLabels").IsEnabled = $true
    $window.FindName("lblStatus").Content = "Labels geladen: $($labels.Count)"
    $window.FindName("lblStatus").Foreground = "DarkGreen"
    Write-GuiLog "Sensitive Labels neu eingelesen $($labels.Count) geladen." "ok"

    Stop-Spinner $window
})

